script: |
  super -f text -I q11580.spq | sort > q11580.out

inputs:
  - name: q11580.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - col2 + - col0 * + ( - col1 ) * + - col1 + - col2 + + col1 + ( + col0 ) * + CAST ( col2 AS INTEGER ) IS NULL OR NOT + 76 IS NULL;
  - name: tab1

outputs:
  - name: q11580.out
    data: |
      51	14	96
      85	5	59
      91	47	68
